            Assert.IsTrue(topRegions.Count == 10); 
        }

        [TestMethod]
        public async Task Get_Top_Regions_Should_Throws_Exception_When_The_Api_Failed()
        {
            //arrange 
            var reportServoce = new ReportService(Options, MockServiceThirdPartyApi.Object);
            MockServiceThirdPartyApi.Setup(x => x.SendToThirdPartyApi(HttpVerbs.Get, Options.Value.CovidApiUrl,
                "reports", It.IsAny<object>(), It.IsAny<Dictionary<string, string>>())).ReturnsAsync(
                new HttpResponseMessage
                {
                    ReasonPhrase = "Api Failed",
                    StatusCode = HttpStatusCode.InternalServerError
                });

            // assert
            try
            {
                var topRegions = await reportServoce.GetTopRegions();
            }
            catch (Exception e)
            {
                Assert.AreEqual("Api Failed", e.Message);
            }
        }

